import React from 'react';
import logo from './logo.svg';
import './Nav.css';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';

const menus = [
  {id: 1, title: 'Lorem', link: '/'},
  {id: 2, title: 'Ipsum', link: '/ipsum'},
  {id: 3, title: 'Dolor', link: '/dolor'},
  {id: 4, title: 'Sit Amet', link: '/sit-amet'}
]

function NavLeft(props) {
  const menu = props.menus.map((menu) =>
    <a key={menu.id}
      className="Nav-item"
      href={menu.link}>
      {menu.title}
    </a>
  );

  return (
    <div className="Nav-left">
      {menu}
    </div>
  );
}

function NavRight() {
  return (
    <div className="Nav-right">
      <a className="Nav-brand"
        href="/" >
        Lorem Ipsum
      </a>
    </div>
  );
}

function Nav() {
  return (
    <Router>
      <nav className="Nav">
        <NavLeft menus={menus} />
        <NavRight />
      </nav>
    </Router>
  );
}

export default Nav;
